import './App.css';
import { React } from 'react';


function SignUp() {
  return (
    <>
      <div className="bg-green-300 h-20 flex justify-center text-4xl py-2">Chat-App</div>
      <div className="h-40 my-3 flex justify-center">
        <form action="">
          <fieldset className='border-4 border-double border-purple-900 h-96 w-96'>
            <legend className='flex mx-auto'>Sign Up DETAILS</legend>
            <label htmlFor="name_id" className='ml-10 relative top-4'>Username</label> <br />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72 rounded-md ' required="required" type="text" id="name_id" placeholder='Enter your Username' />
            <br />
            <label htmlFor="number_id" className='ml-10 top-4 relative' required="required">Password</label> <br />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72' type="password" name="number_name" id="number_id" placeholder='Enter your Password' />
            <br />
            <button  className="bg-green-700 hover:bg-green-400 mt-4 ml-10 w-72 h-10">Sign Up</button>
          </fieldset>
        </form>
      </div>
    </>
  );
}

export default SignUp;
